import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import TopView from "./views/topView";
import ProjectTitles from "./views/projectView";
import Footer from "./components/Footer"; // フッターをインポート

const App = () => {
  return (
    <Router>
      <div className="appContainer">

      <Routes>
        <Route path="/" element={<TopView />} /> {/* トップページ */}
        <Route path="/projects" element={<ProjectTitles />} /> {/* 案件詳細ページ */}
      </Routes>
      <Footer /> {/* フッターを追加 */}
      </div>
    </Router>
  );
};

export default App;
